  /**
   * {@inheritdoc}
   */
  public function safeUp()
  {
    $this->truncateTable($this->regionTableName);
    $this->truncateTable($this->cityTableName);
    $regionData = \yii\helpers\Json::decode($this->regionsJson);
    foreach ($regionData as $region) {
      $this->insert($this->regionTableName, $region);
    }
    $regionsCollection = \common\models\object\Region::find()->all();
    $regions = \yii\helpers\ArrayHelper::map($regionsCollection, 'name', 'id');
    $cityData = \yii\helpers\Json::decode($this->citiesJson);
    $cityNames = [];
    foreach ($cityData as $city) {
      $city['region_id'] = $regions[$city['region']];
      unset($city['region']);
      if (!in_array(mb_strtolower($city['name']), $cityNames)) {
        $this->insert($this->cityTableName, $city);
        $cityNames[] = mb_strtolower($city['name']);
      }
    }
  }

  /**
   * {@inheritdoc}
   */
  public function safeDown()
  {
    $regionData = \yii\helpers\Json::decode($this->regionsJson);
    $cityData = \yii\helpers\Json::decode($this->citiesJson);
    $cityNames = [];
    foreach ($cityData as $city) {
      $cityNames[] = $city['name'];
    }
    $this->delete($this->cityTableName, ['in', 'name', $cityNames]);
    $regionNames = [];
    foreach ($regionData as $region) {
      $regionNames[] = $region['name'];
    }
    $this->delete($this->regionTableName, ['in', 'name', $regionNames]);
  }
